import React, { Component } from 'react'
import { Link} from "react-router";

export default class APP extends Component {
    render() {
        return (
            <div>
                <div>选择页面</div>

                <Link to='/game' style={{height:'30px'}}>game</Link>
                <Link to='/dom' style={{marginLeft:'10px',height:'30px'}}>dom</Link>

                {this.props.children}

            </div> 
        )
    }
}
